{"1": {"comment_id": "bewellrecipe"  "comment_text": "🇫🇷La galette poire  pear galette (Western France)🍐
The French pastry you need to try! The center of the dessert is filled with frangipane  a cream made from sweet almonds  butter  eggs and fruits. It’s one of the most beloved dishes in the French cuisine🥰

🍏As a nutritionist I promote healthy lifestyle. Personally I don’t follow any diet (in my opinion perfect diet doesn’t exist)  my food is based on natural  least processed ingredients. I choose organic  seasonal products  if possible from local farmers. The closer to nature  the better. I limit highly refined sugar  prefer home made food  however at the same time I strongly believe that moderation is a key. That’s why once in a while I do eat „unhealthy” goodies. As long as it is not a routine it’s not going to destroy your well-being😜

